import styled from 'styled-components';

export const Container = styled.div`
  margin-bottom: 12px;
  display: flex;
  align-items: center;

  button {
    margin-right: 12px;
    background-color: transparent;
    color: #013c64;
    border: 0;
    line-height: 0;
  }
`;
